class UnitfulMock(MockInstrument):

    def min_value(self):
        return 0

    def max_value(self):
        return 10
    unitful_property = unitful_property('MOCK', u.hertz, valid_range=(
        min_value, max_value))
mock_inst = UnitfulMock()
mock_inst.unitful_property = 0
mock_inst.unitful_property = 10
assert mock_inst.value == """MOCK {:e}
MOCK {:e}
""".format(0, 10)
